postcontent:
This is a custom Springfield M1A SOCOM II Rifle in like new condition (less than 100 rounds fired) with one factory ten round magazine and the following upgrades:
(1) Smith Enterprise SOCOM 16/II Kit (with screw on Smith Enterprise Muzzle Brake (installed) and Vortex Flashhider (included but not installed));

(2) Smith Enterprise Extended Bolt Stop;

(3) A.R.M.S. Optics Mount;

(4) Fulton Armory Fiberglass Reinforced Black Polymer Handguard;

(5) Sadlak TiN Coated Gas Piston;

(6) Sadlak Spring Guide; and

(7) Front Stock Swivel with Picatinny Rail

This rifle has virtually every modern upgrade for the M1A platform and is in like new condition (less than 100 rounds).

Note this rifle does not come with the ridiculously heavy Springfield SOCOM II rail--it instead has the far superior A.R.M.S. optics mount installed.

Federal .22 LR 525 round value pack, 3 bricks available;
Winchester .22 LR M22 40 grain, 1255 FPS, 1 bricks available. 

Ask for $70 PER 525 rounds OBO. Cash only. Pick up near Pitt or north hills area.
